`,y.jsx(t.p,{children:"Ever wondered how multiplayer games handle real time gameplay, matchmaking & leaderboards? If not, stay tuned, I recently built a fully functional multiplayer tic-tac-toe game to explore these concepts, lets goo!"}),`
`,y.jsxs(t.p,{children:["I'm using ",y.jsx(t.strong,{children:"Nakama"})," as the game server and ",y.jsx(t.strong,{children:"React Native"})," for the mobile client, ",y.jsx(t.strong,{children:"Go"})," for custom game logic and finally ",y.jsx(t.strong,{children:"PostgreSQL"})," for data persistence."]}),`
`,y.jsx(t.h3,{children:"Why Nakama though?"}),`
`,y.jsx(t.p,{children:"So Nakama solves multiple complex problems out of the box for us like passwordless authentication, real time communication b/w players, matchmaking players together, fetching game state, leaderboards, player profiles, scales across multiple concurrent matches and lastly it is open source!"}),`
`,y.jsxs(t.p,{children:["Now we can freely implement the app logic instead of worrying about infra, nakama natively handles whopping scale of approx ",y.jsx(t.a,{href:"https://heroiclabs.com/blog/code-wizards-scale-test-of-nakama-2m-ccu/",children:"2M concurrently connected players (CCU)"}),"!"]}),`
`,y.jsxs(t.p,{children:["Nakama also needs a data persistence to store data in the long term. It currently is compatible with cockroach db and postgresql.",y.jsx("br",{})]}),`
`,y.jsx(t.p,{children:y.jsx(t.img,{src:"/blogs/1/image.png",alt:"news"})}),`
`,y.jsx(t.h2,{children:"Architecture"}),`
`,y.jsxs(t.p,{children:["The ",y.jsx(t.strong,{children:"HTTP/gRPC"})," port handles stateless operations like authentication, fetching leaderboard, user profiles. While the ",y.jsx(t.strong,{children:"web socket"})," port handles any real time match updates, player moves, broadcasts, .."]}),`
`,y.jsx(t.p,{children:y.jsx(t.img,{src:"/blogs/1/arch.png",alt:"Architecture Diagram"})}),`
