`,y.jsx(t.h4,{children:"Step 3: Implementing Matchmaking"}),`
`,y.jsx(t.p,{children:"Nakama's built-in matchmaker pairs players automatically:"}),`
`,y.jsx(t.pre,{children:y.jsx(t.code,{className:"language-typescript",children:`// Client requests matchmaking
const ticket = await socket.addMatchmaker('*', 2, 2);

